import React, { useState } from "react";
import './AddWeatherForm.css';

const AddWeatherForm = ({ onAddWeather }) => {
    const [formData, setFormData] = useState({
        cuaca: "",
        tempC: "",
        tempF: "",
        humidity: "",
        jamCuaca: "",
        kodeCuaca: "",
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        onAddWeather(formData);
    }

    const weatherIcons = [
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/1.png" alt="Weather Icon" />,
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/2.png" alt="Weather Icon" />,
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/3.png" alt="Weather Icon" />,
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/0.png" alt="Weather Icon" />,
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/4.png" alt="Weather Icon" />,
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/45.png" alt="Weather Icon" />,
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/60.png" alt="Weather Icon" />,
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/61.png" alt="Weather Icon" />,
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/63.png" alt="Weather Icon" />,
        <img id='img-1' src="https://ibnux.github.io/BMKG-importer/icon/95.png" alt="Weather Icon" />
    ];

    const Detail = ({ id }) => {
        const [datas, setDatas] = useState([]);
        const [selectedWeatherIcon, setSelectedWeatherIcon] = useState('');

        useEffect(() => {
            fetchWeather();
        }, [id]);

        const handleSelectChange = (event) => {
            setSelectedWeatherIcon(event.target.value);
        };

    }
    return (
        <div className="container-2">
            <section className="form">
                {/* <div className="form-left">
                    <img src="https://picsum.photos/200/300?random=1" alt="img-form" />
                </div> */}
                <div className="form-right">
                    <form onSubmit={handleSubmit}>
                        <div>
                            <label className="label" for="provinsi">Cuaca</label>
                            <input className="input" type="text" id="cuaca" name="cuaca" onChange={handleChange} />
                        </div>

                        <div>
                            <label className="label" for="kota">Fahrenhit</label>
                            <input className="input" type="text" id="tempF" name="tempF" onChange={handleChange} />
                        </div>
                        <div>
                            <label className="label" for="kecamatan">Celcius</label>
                            <input className="input" type="text" id="tempC" name="tempC" onChange={handleChange} />
                        </div>
                        <div>
                            <label className="label" for="kecamatan">Kelembapan</label>
                            <input className="input" type="text" id="humidity" name="humidity" onChange={handleChange} />
                        </div>
                        <div>
                            <label className="label" for="kecamatan">Waku Cuaca</label>
                            <input className="input" type="time" id="jamCuaca" name="jamCuaca" onChange={handleChange} />
                        </div>
                        <div>
                            <label className="label" for="kecamatan">Kode Cuaca</label>
                            <input  type="url" />
                        </div>

                        <button className="button" type="submit">Submit</button>
                    </form>
                </div>
            </section>
        </div>
    )
}

export default AddWeatherForm;
